import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { StoreDevtoolsModule } from '@ngrx/store-devtools';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { FudbalskitimComponent } from './components/fudbalskitim/fudbalskitim.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { HttpClient, HttpClientModule } from '@angular/common/http'
import { EffectsModule } from '@ngrx/effects';
// import { TimEffects } from './store/igrac.effects';
import { StoreModule } from '@ngrx/store';
import { timReducer } from './store/igrac.reducer';
// import { timReducer } from './store/igrac.reducer';

@NgModule({
  declarations: [
    AppComponent,
    FudbalskitimComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule,
    HttpClientModule,
    // PROVERI OVAJ ISPOD???
    StoreModule.forRoot({ timovi: timReducer }),
    // EffectsModule.forRoot([TimEffects]),
    StoreDevtoolsModule.instrument({
      maxAge: 25, // Retains last 25 states
      autoPause: true, // Pauses recording actions and state changes when the extension window is not open
    }),
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
